import React from 'react';
import PropTypes from "prop-types";

const Gasto = ({ gasto }) => (
    <li className="gastos">
        <p>
            {gasto.nombre}
            <span className="gasto">
                {gasto.cantidad}
                <button className="alert alert-danger">
                    x
                </button>
            </span>
        </p>
    </li >
);

Gasto.propTypes = {
    gasto: PropTypes.object.isRequired
}

export default Gasto;
